class Solution {
    public int minOperations(List<Integer> nums, int target) {
        long sum = 0;
        int maxPow = 0;
        for (int num : nums) {
            sum += num;
            maxPow = Math.max(maxPow, Integer.highestOneBit(num));
        }
        if (sum < target) return -1;
        int operations = 0;
        while (sum > target) {
            if (maxPow <= target || !nums.contains(maxPow)) {
                maxPow >>= 1;
                continue;
            }
            nums.remove(Integer.valueOf(maxPow));
            nums.add(maxPow >> 1);
            nums.add(maxPow >> 1);
            sum -= maxPow >> 1;
            operations++;
        }
        return operations;
    }
}
